import React from "react";

const Participants = () => {
  return (
    <a href="profile.html" className="participant">
      <div className="avatar avatar--medium">
        <img src="https://randomuser.me/api/portraits/men/37.jpg" />
      </div>
      <p>
        Dennis Ivy
        <span>@dennis_ivy</span>
      </p>
    </a>
  );
};

export default Participants;
